package javaPatterns;

public class Package22 {
//komal edited this code 
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (char i='E';i>='A';i--)
	    {
	    	for(char j='A';j<=i;j++)
	    	{
	    		System.out.print(i);
	    		System.out.print("*");
	    		System.out.print(j);
	    	}
	    	System.out.println("");
	    }
	}

}
